<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8"/>
    <meta name="viewport" content="width=device-width, initial-scale=1.0"/>
    <title>Teamfu</title>
</head>
<style>
        body {
            margin: 0;
            height: 100vh;
            overflow: hidden;
        }

        #app {
            height: 95%;
            padding: 20px 40px;
            display: flex;
            flex-direction: column;
            justify-content: space-between;
            font-family: sans-serif;
        }

        .main {
            width: 100%;
            height: 80%;
            display: flex;
            flex-direction: column;
            justify-content: space-between;
        }

        .title-generate-wrapper {
            height: 80%;
            display: flex;
            justify-content: space-between;
            align-items: center;

        }

        .title-generate-block {
            width: 50%;
            height: 100%;
            display: flex;
            flex-direction: column;
            justify-content: space-between;
        }

        .title-block {
            display: flex;
            height: 80%;
            align-items: flex-start;
            justify-content: center;
            flex-direction: column;
        }

        .title {
            font-size: 70px;
            color: #881719;
            font-weight: bold;
            cursor: default;
        }

        .title-description {
            font-size: 20px;
        }

        .generate-block {
            display: flex;
            justify-content: space-between;
            align-items: center;
        }

        .generate-block input {
            border: 1px solid #881719;
            width: 70%;
            height: 30px;
            background-color: #999999;
            padding: 0 20px;
            color: white;
            font-size: 15px;
        }

        .generate-block button {
            background-color: #881719;
            border: none;
            color: white;
            border-radius: 5px;
            height: 30px;
            width: 20%;
            cursor: pointer;
        }

        ::-webkit-input-placeholder { /* WebKit browsers */
            color: white;
            padding-left: 30%;
         }
         :-moz-placeholder { /* Mozilla Firefox 4 to 18 */
            color: white;
            padding-left: 30%;
         }
         ::-moz-placeholder { /* Mozilla Firefox 19+ */
            color: white;
            padding-left: 30%;
         }
         :-ms-input-placeholder { /* Internet Explorer 10+ */
            color: white;
            padding-left: 30%;
         }

         .curl-wrapper {
            height: 15%;
            font-size: 20px;
         }

         .curl-field {
            height: 50px;
            margin: 10px 0;
            border: 1px solid #881719;
            background-color: #999999;
            font-size: 15px;
            padding: 0 20px;
            display: flex;
            align-items: center;
         }

         .copyright {
             width: 100%;
             height: 5%;
             display: flex;
             justify-content: space-between;
             align-items: center;
             font-size: 18px;
         }

         .github img {
            margin-right: 10px;
            width: 10%;
         }

         .copyright a {
            text-decoration: none;
            color: black;
         }

         .cyber-mint, .github {
            display: flex;
            align-items: center;
            justify-content: flex-end;
         }

         .cyber-mint {
            width: 52%;
         }

         .cyber-mint img {
            width: 7%;
         }

</style>
